import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Head from "next/head";
import SEO from "react-seo-component";

import Layout from "../components/Layout";

// Style for the onft icons
const liStyles = {
  display: "inline!important",
  paddingLeft: "50px"
};

const oLiStyles = {
  display: "inline"
};

const ulStyles = {
  listStyleType: "none",
  paddingTop: "15px"
};

const Index = props => (
  <Layout>
    <SEO
      title="Contact | CXC Spanish Guide"
      description={
        "Contact Us. Whether you're a beginner or just looking for some refreshers, we want to express gratitue for letting us be a part of your journey."
      }
      image={""}
      pathname={"https://www.cxcspanish.com/contact"}
      siteLanguage={"en"}
      siteLocale={""}
      twitterUsername={"cxcspanish"}
    />
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Contact</BreadcrumbItem>
      </Breadcrumb>
      <Row>
        <Col sm={12} md={8} lg={8}>
          <span className="border border-light">
            <ul style={ulStyles}>
              <li style={oLiStyles}>
                <i style={{ color: "#8a3ab9" }} className="fab fa-instagram" />
                <a
                  className="text-muted"
                  style={{ paddingLeft: "10px" }}
                  href=""
                  target="_blank"
                >
                  cxcspanish
                </a>
              </li>
              <li style={liStyles}>
                <i style={{ color: " #3b5998" }} className="fab fa-facebook" />
                <a
                  className="text-muted"
                  style={{ paddingLeft: "10px" }}
                  href=""
                  target="_blank"
                >
                  CXC Spanish Gude
                </a>
              </li>
              <li style={liStyles}>
                <i style={{ color: "#00acee" }} className="fab fa-twitter" />
                <a
                  className="text-muted"
                  style={{ paddingLeft: "10px" }}
                  href=""
                  target="_blank"
                >
                  cxcspanish
                </a>
              </li>
            </ul>
          </span>
          <Card>
            <CardBody></CardBody>
          </Card>
        </Col>
        <Col sm={12} md={4} lg={4}></Col>
      </Row>
    </Container>
  </Layout>
);

export default Index;
